import Button from "../components/Button";
import styled from "styled-components";

function StyleGuide() {
    const test = () => console.log("bbbb");

    return (
        <div style={{ maxWidth: '1200px', margin: 'auto', padding: '60px 20px' }}>
            <h1>Shilly Styleguide</h1>

            <Section>
                <h2>Buttons</h2>
                <Button variant='primary' size='small' onClick={test}>helo</Button>
                <Button variant='primary' size='big' disabled onClick={test}>helo</Button>

                <Button variant='secondary' onClick={test}>secondary btn</Button>
                <Button variant='tertiary'>tertiry btn</Button>
                <Button variant='destructive' disabled>delete disabled</Button>
                <Button variant='destructive'>delete nodisabled</Button>
            </Section>


        </div>
    );
}

const Section = styled.section`
    margin: 60px 0;
`;


export default StyleGuide;
